import React from 'react';

import Todo from './Todo';


const Todos = (props) => {
  const gjøremål = Object().keys(props.handling).map((item, i) => (
    <Todo
      key={i}
      handling={item}
      deleteTodo={props.deleteTodo.bind(this,i)}
      editTodo={props.editTodo.bind(this,i)}
      finishTodo={props.finishTodo.bind(this,i)}
      todoStyle={props.todoStyle}
    />
  ))

  /*const handlinger = props.handling.map((hand, index) => {
    return <Todo
      key={index}
      handling={hand}
      deleteTodo={props.deleteTodo.bind(this,index)}
      editTodo={props.editTodo.bind(this,index)}
      finishTodo={props.finishTodo.bind(this,index)}
      todoStyle={props.todoStyle}
    />
  });*/

  return <div className="ui container">{gjøremål}</div>
};

export default Todos;
